import Day from './Day'
import '../DisplayPage.css'
import deepblue from '../Images/deep-blue-lipstick.png'
import navyblue from '../Images/navyblue.png'
import teal from '../Images/teal.png'
import paint from '../Images/paint.png'
import pajamas from '../Images/pajamas.png'
import car1 from '../Images/car1.png'
import car2 from '../Images/car2.png'
import day1Schedule from '../schedule/day1_schedule.json'
import day2Schedule from '../schedule/day2_schedule.json'
import day3Schedule from '../schedule/day3_schedule.json'
import Day1 from './Day1'




function DisplayPage() {
    return(
        <div className='display-page'>
            {/* <img src={bubble} alt='bground' className='bubble-background'/> */}
            <Day 
                image1 = { deepblue }
                image2 = { navyblue }
                image3 = { teal }
                date = { '19th' }
                txtColor = { '#5F754F' }
                schedule = { day1Schedule }
                day = { <Day1/> }
                />
            <Day
                image1 = { paint }
                image2 = { pajamas }
                date = { '20th' }
                txtColor = { '#1E4A9C' }
                schedule={ day2Schedule }
                />            
            <Day
                image1 = { car1 }
                image2 = { car2 }
                date = { '21st' }
                txtColor = { '#101040' }
                schedule={ day3Schedule }
                />

        </div>
    )
}

export default DisplayPage
